import React from "react"
import Nav from "react-bootstrap/Nav";
import { Link } from "react-router-dom";

import NavItem from "./SecondaryNav/NavItem";

const SecondaryNav = () => {
  const datas = [
    {
      "title": "IDR",
      "content": [
        {
          "title": "Indonesian Rupiah (IDR)"
        },
        {
          "title": "US Dollar (USD)"
        }
      ]
    },
    {
      "title": "Account"
    },
    {
      "title": (
        <>
          <i className="fa-solid fa-bag-shopping" id="open-cart"></i>
          <span> (0)</span>
        </>
      ),
      "class": "open-cart",
    },
  ];

  return (
    <>
      <Nav className="navbar navbar-expand-lg secondary-nav hidden-phone">
        {datas.map((data, i) => {
          return <NavItem data={data} key={i} />
        })}
      </Nav>
      <Link to="#" className="hidden-desk">
        <i class="fa-solid fa-user"></i>
      </Link>
      <Link to="#" className="hidden-desk">
        <i class="fa-solid fa-magnifying-glass"></i>
      </Link>
      <Link to="#" className="hidden-desk">
      <i class="fa-solid fa-bag-shopping" id="Open Cart"></i>
      </Link>
    </>

  )
}

export default SecondaryNav
